import React, { useState } from "react";

const useRobohash = () => {
  const [myRoboImg, setMyRoboImg] = useState;
  fetch("https://robohash.p.rapidapi.com/index.php?text=mashape", {
    method: "GET",
    headers: {
      "x-rapidapi-host": "robohash.p.rapidapi.com",
      "x-rapidapi-key": "undefined",
    },
  })
    .then((response) => {
      console.log(response);
      setMyRoboImg(response);
    })
    .catch((err) => {
      console.error(err);
    });
  return myRoboImg;
};
export default useRobohash;
